import styled from 'styled-components';

export const Container= styled.div `
 position:relative ;
 left:5%;
 width:90%;
 height: 600px;
 background-color: #333;
`;
export const Cardprof = styled.div`
  width:300px;
  height: 100px;
  background-image: url('./');
  background-size: cover;
  background-repeat: no-repeat;
`;
